import React from 'react';
import logo from './covid-logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Stop The Spread
        </p>
      </header>
    </div>
  );
}

export default App;
